import React from "react";
import {Link} from "react-router-dom";
import "./App.css";

function Header(){
    return (
    <header>
            <nav>
               <Link to="/login" className="link">Log In</Link>
               <Link to="/signup" className="link">Sign Up</Link> 
            </nav>
    </header>
    )
}

export default Header;
